import "./App.css";
import Navbar from "./components/Navbar";
import Karte from "./components/Karte";
import TagSlide from "./components/TagSlide";

function App() {
    return (
        <>
            <Navbar />
            <TagSlide />
            <Karte />
        </>
    );
}

export default App;
